  "geo" : { },
  "id_str" : "381617784993480705",
  "text" : "He starts rising higher, but at a slow pace. Not nearly as fast as she when your flight profile has changed. \"Okay, so far, @mlp_Xenoterra.\"",
  "id" : 381617784993480705,
