  "geo" : { },
  "id_str" : "381608393397399552",
  "text" : "\"As much as I'd love that, @mlp_xenoterra, sadly, we stallions have this dated concept we call pride. ... and I'm stubborn.\"",
  "id" : 381608393397399552,
  "created_at" : "2013-09-22 02:38:25 +0000",
