  "geo" : { },
  "id_str" : "381607499721216000",
  "text" : "He groans in direct response. \"Maybe if I were a mudcrab, @mlp_xenoterra, but ...\" Starhammer used sit on rock, it wasn't that effective ...",
  "id" : 381607499721216000,
