  "geo" : { },
  "id_str" : "381597389800230914",
  "text" : "\"A while back, back when I was still in the guard, @mlp_Xenoterra, a cadet put out a challenge to me. Can I walk a mile in her hoofboots?\"",
  "id" : 381597389800230914,
  "created_at" : "2013-09-22 01:54:42 +0000",
